/*******************************************************************************

Purpose:
  (Lunar Prospector GRAIL150 Lunar Gravity Field,
   Retrieved and truncated from the 660x660 (gggrx_0660pm_sha.tab) fully normalized
   gravity coefficients data from NASA Planetary Data System (PDS) web page released
   on 8/14/2013.

   https://pds-geosciences.wustl.edu/grail/grail-l-lgrs-5-rdr-v1/grail_1001/shadr/)

References:
  (((Konopliv, A.S., et al.)(Recent Gravity Models as a Result of the Lunar
     Prospector Mission)(Icarus, International Journal of Solar System
     Studies, vol. 150)(2001))

   ((Gottlieb, Robert G.) (Fast Gravity, Gravity Partials, Normalized
     Gravity, Gravity Gradient Torque and Magnetic Field: Derivation,
     Code and Data)(NASA Contractor Report 188243)(NASA Johnson Space
     Center Document 23762) (Feb 1993)))

Assumptions and Limitations:
  ((1. Gravity coefficients are fully normalized as defined in Gottlieb and
       other standard references.)
   (2. Gravity coefficients are static; no temporal variation.)
   (3. The C(2,0) coefficient is in a "tide-free" system (i.e. the permanent
       tide is not included)))

*******************************************************************************/

